import React from "react";
import emotion from "@emotion/styled";
import { css } from "@emotion/react";

//rewrite this component to use emotion
const PrimeBtn = emotion.button`
    background: white;
    cursor: pointer;
    color: black;
    border: none;
    padding: 0.5rem 1rem;
    border-radius: 5px;

    &:hover {
        background: #f040be;
        transition: all 0.3s ease-in-out;
    }
`;

export type PrimeBtnProp = {
  text: string;
};

const PrimaryBtn = (props: PrimeBtnProp) => {
  return <PrimeBtn>{props.text}</PrimeBtn>;
};

export default PrimaryBtn;
